package com.example.admin.itsnotmydish;

import android.annotation.SuppressLint;
import android.content.Intent;
import android.support.v7.app.AppCompatActivity;
import android.os.Bundle;
import android.view.View;
import android.widget.ImageView;
import android.widget.ListView;
import android.widget.Toast;

import java.util.ArrayList;
import java.util.List;

@SuppressLint("Registered")
public class MainActivity extends AppCompatActivity implements FoodFreeviewListItemAdapter.ItemSeleted {

    List<FoodFreeviewItem> foodList;
    FoodFreeviewListItemAdapter foodFreeviewListItemAdapter;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);

        ImageView mapbutton = findViewById(R.id.Map_Buton);
        mapbutton.setOnClickListener(new View.OnClickListener() {
            public void onClick(View v) {
                Intent intent = new Intent(MainActivity.this, MainMapActivity.class);
                startActivity(intent);
            }
        });

        foodList = new ArrayList<>();

        ListView foodListView = findViewById(R.id.Food_freeview_List);

        foodList.add(new FoodFreeviewItem("간장게장", "89m", "이효성", "data:image/jpeg;base64,"));
        foodList.add(new FoodFreeviewItem("돼지두루치기", "112m", "최욱진", "data:image/jpeg;base64,"));
        foodList.add(new FoodFreeviewItem("김치전", "132m", "박태형", "data:image/jpeg;base64,"));
        foodList.add(new FoodFreeviewItem("공기밥", "144m", "이유승", "data:image/jpeg;base64,"));
        foodList.add(new FoodFreeviewItem("감자", "176m", "나동혁", "https://s-i.huffpost.com/gen/3839686/thumbs/o-POTATO-570.jpg?4"));

        foodFreeviewListItemAdapter = new FoodFreeviewListItemAdapter(this, foodList);

        foodListView.setAdapter(foodFreeviewListItemAdapter);

        foodListView.getAdapter().getItem(0);

    }

    public void LogoutButton(View v) {
        Toast toast = Toast.makeText(this, "로그아웃 되었습니다.", Toast.LENGTH_SHORT);
        toast.show();

        finish();

    }

    public void AlramButton(View v) {
        Toast toast = Toast.makeText(this, "알람 버튼 입니다.", Toast.LENGTH_SHORT);
        toast.show();

    }

    public void MapButton(View v) {
        Toast toast = Toast.makeText(this, "지도 버튼 입니다.", Toast.LENGTH_SHORT);
        toast.show();

    }

    public void MypageButton(View v) {
        Toast toast = Toast.makeText(this, "프로필변경 버튼 입니다.", Toast.LENGTH_SHORT);
        toast.show();

    }

    public void ListButton(View v) {
        Toast toast = Toast.makeText(this, "리스트 버튼 입니다.", Toast.LENGTH_SHORT);
        toast.show();

    }

    @Override
    public void selectItem(int pos) {
        Intent intent = new Intent(this, subImpormation.class);
        intent.putExtra("ListData", foodList.get(pos));
        startActivity(intent);

    }

}
